import re

def extract_code(filename):
    try:
        pattern = r"([0-9]+)-([A-Za-z0-9]{3})\.usfm"
        match = re.search(pattern, filename)

        if match is not None:
            return match.group(2)
        else:
            return None
    except Exception as e:
        print("Error:", str(e))
        return None
